tables.table_schema:
CREATE TABLE quantum_algorithm_metrics (
    algorithm_id SERIAL PRIMARY KEY,
    algorithm_name VARCHAR(255),
    execution_time FLOAT,
    memory_consumption FLOAT
);

CREATE TABLE quantum_machine_learning_models (
    model_id SERIAL PRIMARY KEY,
    model_name VARCHAR(255),
    dataset_size INT,
    training_time FLOAT
);

CREATE TABLE performance_metrics (
    algorithm_id INT PRIMARY KEY,
    algorithm_name VARCHAR(255),
    execution_time DOUBLE,
    success_rate DOUBLE
);

CREATE TABLE quantum_algorithms (
    algorithm_id INT PRIMARY KEY,
    algorithm_name VARCHAR(255),
    description TEXT,
    researcher_name VARCHAR(255)
);

CREATE TABLE machine_learning_models (
    model_id INT PRIMARY KEY,
    model_name VARCHAR(255),
    training_time DOUBLE,
    accuracy DOUBLE
);

CREATE TABLE QuantumAlgorithms(
    algorithm_id UUID PRIMARY KEY,
    algorithm_name TEXT NOT NULL,
    quantum_bits INT NOT NULL,
    performance_score FLOAT NOT NULL
);
